function CarouContentBtn() {
  return (<>
    <Link to={'/thuc-don'}>
      <ConfigProvider
        theme={{
          components: {
            Button: btnC,
          },
        }}
      >
        <Button className='px-5 py-4 playfair-0'>
          Tìm hiểu ngay
        </Button>
      </ConfigProvider>

    </Link>
  </>);
}
export default CarouContentBtn;
